  const [contact,setContact]=useState(boxes)
  let box=contact.map(
    (a)=>(
      function toggleColor(){
        setContact(prevS=>[...prevS,!contact.on])
      },
    <Boxie theId={a.id} isOn={a.toggleColor} isValue={a.on}/>)
  )
  return (
    <div >
      {box}
    </div>

  )
};
export default App;
